import React from "react";
import { AppBar, Toolbar, Typography, Button } from "@mui/material";
import { useNavigate } from "react-router-dom"; // Import useNavigate from react-router-dom

const Header = () => {
  const navigate = useNavigate(); // Initialize useNavigate

  const goToProjects = () => {
    // Navigate to the Projects slide
    navigate("/Projects");
  };

  const goToResume = () => {
    // Navigate to the Resume slide
    navigate("/resume");
  };

  const goToSkills = () => {
    // Navigate to the Skills slide
    navigate("/skills");
  };

  const goToContact = () => {
    // Navigate to the Contact slide
    navigate("/contact");
  };

  return (
    <AppBar position="fixed" color="transparent" elevation={0}>
      <Toolbar>
        <Typography variant="h5" sx={{ flexGrow: 1, textDecoration: 'none', color: 'inherit' }}>
          PORTFOLIO
        </Typography>
        <Button color="inherit" onClick={goToProjects}>
          Projects
        </Button>
        <Button color="inherit" onClick={goToResume}>
          Resume
        </Button>
        <Button color="inherit" onClick={goToSkills}>
          Skills
        </Button>
        <Button color="inherit" onClick={goToContact}>
          Contact
        </Button>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
